import React from "react";
import "./GoalForm.css";
const GoalFrom = () => {
  return (
    <div className="goalForm">
        <form>
      <h1 className="goalForm_title">Your Goals</h1>
      <input className="goalForm_input" type="text" />
      <br />
      <button className="goalForm_btn">Add Goal</button></form>
    </div>
  );
};

export default GoalFrom;
